// motion-impossible-frontend/src/components/Timeline.js
import React from 'react';
import styled from 'styled-components';

const TimelineContainer = styled.div`
  position: relative;
  /* Add other styling as needed */
`;

const Playhead = styled.div`
  background-color: blue;
  height: 100%;
  width: 2px;
  position: absolute;
`;

const Clip = styled.div`
  background-color: lightgray;
  height: 1000px;
  width: ${props => props.duration}px;
  position: absolute;
  /* Additional styling properties as needed */
`;

const VideoClip = styled.video`
  /* Styling for the video element */
  height: 100%;
  width: 100%;
  object-fit: cover; /* Adjust as needed */
`;

const Timeline = () => {
  return (
    <TimelineContainer>
      <Clip duration={100} style={{ top: '10px', left: '50px' }}>
        {/* Placeholder video for the clip */}
        <VideoClip controls>
          <source src="./videos/Grapes.mp4" type="video/mp4" />
          Your browser does not support the video tag.
        </VideoClip>
      </Clip>
      {/* Additional clips go here */}
    </TimelineContainer>
  );
};

export default Timeline;
